        id: 1,
        title: 'Ut med søpla.',
        completed: false
      },
      {
        id: 2,
        title: 'Betale regninger.',
        completed: false
      },
      {
        id: 3,
        title: 'Lage Todo liste m/react',
        completed: false
      }
    ]
  }

  console.log(This.state.todos)
  return ( //this is JSX - legg til flere HTML classes med className i App
   <div className="App"> 
      <Todos />
    </div>
  );
